import { HttpClient } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { FlightService } from '../flight.service';
import { WorkflowService } from '../workflow.service';
import { Flight } from '../model/Flight';
@Component({
  selector: 'app-flight-search',
  templateUrl: './flight-search.component.html',
  styleUrls: ['./flight-search.component.css']
})
export class FlightSearchComponent  implements OnInit{
  resultData: any;
  id : any;
  myFlight={} as Flight;
  constructor(private route: ActivatedRoute,private flightService : FlightService,private workflowService : WorkflowService) { }

  ngOnInit(): void {
    this.resultData = history.state.data;
    console.log('Result Data received:', this.resultData);
    this.route.paramMap.subscribe((params: { get: (arg0: string) => any; }) => {
      this.id = params.get('id'); 
    });
  }

  saveFlight(flight: any) {
this.myFlight.idUser=this.id;
this.myFlight.departureDate=flight.
  this.flightService.saveFlight(flight);

  this.workflowService.completeTask4(this.id);

  }
}
<div>
  <h2>Flight Search Result to Tunisia</h2>

  <table *ngIf="resultData && resultData.data && resultData.data.length > 0" class="flight-table">
    <thead>
      <tr>
        <th>Departure Date</th>
        <th>Is Cheapest</th>
        <th>Offset Days</th>
        <th>Price</th>
      </tr>
    </thead>
    <tbody>
      <tr *ngFor="let flight of resultData.data">
        <td>{{ flight.departureDate }}</td>
        <td>{{ flight.isCheapest }}</td>
        <td>{{ flight.offsetDays }}</td>
        <td *ngIf="flight.price" class="price-details">
          <ul>
            <li><strong>Currency Code:</strong> {{ flight.price.currencyCode }}</li>
            <li><strong>Units:</strong> {{ flight.price.units }}</li>
            <li><strong>Nanos:</strong> {{ flight.price.nanos }}</li>
          </ul>
        </td>
        <td>
          <button (click)="saveFlight(flight)">Save Flight</button>
        </td>
      </tr>
    </tbody>
  </table>

  <div *ngIf="!resultData || !resultData.data || resultData.data.length === 0">
    <p>No flight data available</p>
  </div>
</div>
